    return (
        <React.Fragment>
            <Header/>
            <DropInMenu/>
            <Recommender/>
        </React.Fragment>
    )
};

function DropInMenu() {
    return (
        <Router>
            <div id="menu">
                <Link to="/"><p className="menuItem">Recommender</p></Link> 
                <p className="menuItem">Statistics</p>     
                <p className="menuItem">Players</p>    
                <p className="menuItem">Contact</p>            
            </div>

            <Switch>
                <Route path="/">
                    <H/>
                </Route>
            </Switch>
        </Router>

    )
};

export default App;
